import React from "react";
import Link from "next/link";
// import "../styles/MenuItem.scss";

const MenuItem = ({ to, handleClick = () => undefined, children }) => {
  return (
    <Link>
      <a
        className="menu-item"
        type="button"
        href={to}
        onClick={() => handleClick(false)}
      >
        {children}
      </a>
    </Link>
  );
};

export default MenuItem;
